  input: TEXT,SA11A1,SA11A1.38816,"On 3/4/05 we received a contribution from Bruce
    Bodner in the amount of $25,000 which was deposited into our federal account.  Fifteen
    thousand dollars was transferred to our non-federal account on 3/4/05, which can
    accept unlimited contributions from individuals.  A letter was sent to Bruce Bodner
    to advise him of how his deposit was split into our accounts and to offer him
    a chance for a refund.  According to AO 2001-17, the Commission has deemed it
    sufficient to deposit checks exceeding the federal limits into a federal account
    and then to make a transfer to the non-federal account for the portion that exceeds
    the federal limit.  Therefore, year to date aggregate totals reported by Bruce
    Bodner on our report is a reflection of the federal portion of the donor's contributions
    to date."
